data = '''



'''
lines = data.split("\n")

keypad = [
  [0,0,1,0,0],
  [0,2,3,4,0],
  [5,6,7,8,9],
  [0,10,11,12,0],
  [0,0,13,0,0]
  ]

dim = 5
x = 0
y = 2
for l in lines:
  for c in l:
    xp,yp = x,y
    if c == 'U':
      yp = max(0,y-1)
    elif c == 'D':
      yp = min(dim-1,y+1)
    elif c == 'L':
      xp = max(0,x-1)
    elif c == 'R':
      xp = min(dim-1,x+1)
    if keypad[yp][xp]:
      x,y = xp,yp
  print("{:X}".format(keypad[y][x]),end="")
print()
